# Input = ["""     |          
#      |  +--+    
#      A  |  C    
#  F---|----E|--+ 
#      |  |  |  D 
#      +B-+  +--+ """]

Input = Input[0].split("\n")

Row = 0
Column = 19

# Row = 0
# Column = 5

Direction = "Down"
String = ""
Steps = -1
while True:
  Steps += 1
  if Row < 0 or Column < 0 or Row >= len(Input) or Column >= len(Input[0]) or Input[Row][Column] == " ":
    break
  CurrentTile = Input[Row][Column]
  print(Row, Column, CurrentTile, Direction)
  if CurrentTile == "-" or CurrentTile == "|" or ord(CurrentTile) in [(x + 65) for x in range(26)]:
    if ord(CurrentTile) in [(x + 65) for x in range(26)]:
      String = String + CurrentTile
      print(String)
    if Direction == "Down":
      Row += 1
      continue
    if Direction == "Up":
      Row -= 1
      continue
    if Direction == "Left":
      Column -= 1
      continue
    if Direction == "Right":
      Column += 1
      continue
  if CurrentTile == "+":
    #switch directions
    if Direction in ["Down", "Up"]:
      if Column - 1 >= 0:
        print(Input[Row][Column - 1])
        if Input[Row][Column - 1] != " ":
          Column -= 1
          Direction = "Left"
          continue
      if Column + 1 < len(Input[0]):
        if Input[Row][Column + 1] != " ":
          Column += 1
          Direction = "Right"
          continue
    if Direction in ["Right", "Left"]:
      if Row + 1 < len(Input):
        if Input[Row + 1][Column] != " ":
          Row += 1
          Direction = "Down"
          continue
      if Row - 1 >= 0:
        if Input[Row - 1][Column] != " ":
          print("hi")
          Row -= 1
          Direction = "Up"
          continue

print(String)
print(Steps)
    